CREATE TABLE tb_pet (
    owner_id varchar(100) not null primary key,
    name varchar(100),
    type varchar(50) ,
    fur_color varchar(100),
    age int ,
    body_build varchar(100),
);

CREATE TABLE tb_owner (
  id varchar(100) not null primary key,
  name varchar(100),
  tel varchar(100),
  address varchar(100)
);

